INSERT INTO `global_property` VALUES ('birt.birtHome','/usr/bin/birt-runtime-2_3_2/ReportEngine','Specifies the absolute path to the BIRT Report Engine.  Should include ReportEngine subdirectory. (ex. C:/birt-runtime-2_2_0/ReportEngine)',1,'b54c8440-2695-102d-b4c2-001d929acb54'),('birt.database_version','1.0.0','DO NOT MODIFY.  Current database version number for the birt module.',2,'b54c8bc0-2695-102d-b4c2-001d929acb54'),('birt.datasetDir','/home/tomcat5/.OpenMRS/birt/datasets','Specifies the absolute path to the reports dataset directory (for CSV/XML data sources). (ex. C:/Documents and Settings/USERNAME/OpenMRS/reports/datasets)',3,'b54c8cb0-2695-102d-b4c2-001d929acb54'),('birt.defaultReportDesignFile','default.rptdesign','Specifies the name of the default report design file.\r\nExample: default.rptdesign',4,'b54c8d82-2695-102d-b4c2-001d929acb54'),('birt.loggingDir','/home/tomcat5/.OpenMRS/birt/logs','Specifies the absolute path for log files written by BIRT Engine.  (ex. C:/tmp/logs)',5,'b54c8e4a-2695-102d-b4c2-001d929acb54'),('birt.outputDir','/home/tomcat5/.OpenMRS/birt/reports/output','Specifies the absolute path to the report output file when reports are generated. (ex. C:/Documents and Settings/USERNAME/OpenMRS/reports/output)',6,'b54c8f1c-2695-102d-b4c2-001d929acb54'),('birt.reportDir','/home/tomcat5/.OpenMRS/birt/reports','Specifies the absolute path where report design files are uploaded.  (ex. C:/Documents and Settings/USERNAME/OpenMRS/reports)',7,'b54c9304-2695-102d-b4c2-001d929acb54'),('birt.reportOutputFile','/home/tomcat5/.OpenMRS/birt/reports/output/ReportOutput.pdf','Specifies the absolute path to the reports output file.  (ex. C:/Documents and Settings/USERNAME/OpenMRS/reports/output/ReportOutput.pdf)',8,'b54c93d6-2695-102d-b4c2-001d929acb54'),('birt.reportOutputFormat','pdf','Specifies the absolute path to the reports output format.(ex. pdf)',9,'b54c94a8-2695-102d-b4c2-001d929acb54'),('birt.reportPreviewFile','/home/tomcat5/.OpenMRS/birt/reports/output/ReportPreview.pdf','Specifies the absolute path to the report preview file.  (ex. C:/Documents and Settings/USERNAME/OpenMRS/reports/output/ReportPreview.pdf)',10,'b54c9570-2695-102d-b4c2-001d929acb54'),('birt.started','true','DO NOT MODIFY. true/false whether or not the birt module has been started.  This is used to make sure modules that were running  prior to a restart are started again',11,'b54c9638-2695-102d-b4c2-001d929acb54'),('concept.causeOfDeath','5002','Concept id of the concept defining the CAUSE OF DEATH concept',12,'b54c9700-2695-102d-b4c2-001d929acb54'),('concept.cd4_count','5497','Concept id of the concept defining the CD4 count concept',13,'b54c97c8-2695-102d-b4c2-001d929acb54'),('concept.height','5090','Concept id of the concept defining the HEIGHT concept',14,'b54c9890-2695-102d-b4c2-001d929acb54'),('concept.medicalRecordObservations','1238','The concept id of the MEDICAL_RECORD_OBSERVATIONS concept.  This concept_id is presumed to be the generic grouping (obr) concept in hl7 messages.  An obs_group row is not created for this concept.',15,'b54c9958-2695-102d-b4c2-001d929acb54'),('concept.none','1107','Concept id of the concept defining the NONE concept',16,'b54c9a20-2695-102d-b4c2-001d929acb54'),('concept.otherNonCoded','5622','Concept id of the concept defining the OTHER NON-CODED concept',17,'b54ca1f0-2695-102d-b4c2-001d929acb54'),('concept.patientDied','1742','Concept id of the concept defining the PATIEND DIED concept',18,'b54ca2c2-2695-102d-b4c2-001d929acb54'),('concept.reasonExitedCare','1811','Concept id of the concept defining the REASON EXITED CARE concept',19,'b54ca394-2695-102d-b4c2-001d929acb54'),('concept.reasonOrderStopped','1812','Concept id of the concept defining the REASON ORDER STOPPED concept',20,'b54ca452-2695-102d-b4c2-001d929acb54'),('concept.weight','5089','Concept id of the concept defining the WEIGHT concept',21,'b54ca51a-2695-102d-b4c2-001d929acb54'),('concepts.locked','false','true/false whether or not concepts can be edited in this database.',22,'b54ca5e2-2695-102d-b4c2-001d929acb54'),('current_health_center_name','Neno District Hospital','Sets the current health center using the health center name for Ror.',23,'b54ca6aa-2695-102d-b4c2-001d929acb54'),('dashboard.encounters.showEditLink','true','true/false whether or not to show the \'Edit Encounter\' link on the patient dashboard',24,'b54ca772-2695-102d-b4c2-001d929acb54'),('dashboard.encounters.showEmptyFields','true','true/false whether or not to show empty fields on the \'View Encounter\' window',25,'b54ca83a-2695-102d-b4c2-001d929acb54'),('dashboard.encounters.showViewLink','true','true/false whether or not to show the \'View Encounter\' link on the patient dashboard',26,'b54ca902-2695-102d-b4c2-001d929acb54'),('dashboard.encounters.usePages','smart','true/false/smart on how to show the pages on the \'View Encounter\' window.  \'smart\' means that if > 50% of the fields have page numbers defined, show data in pages',27,'b54ca9d4-2695-102d-b4c2-001d929acb54'),('dashboard.encounters.viewWhere','newWindow','Defines how the \'View Encounter\' link should act. Known values: \'sameWindow\', \'newWindow\', \'oneNewWindow\'',28,'b54caa9c-2695-102d-b4c2-001d929acb54'),('dashboard.overview.showConcepts','5096,6364,6367','Comma delimited list of concepts ids to show on the patient dashboard overview tab',29,'b54cab64-2695-102d-b4c2-001d929acb54'),('dashboard.regimen.displayDrugSetIds','ANTIRETROVIRAL DRUGS,TUBERCULOSIS TREATMENT DRUGS','Drug sets that appear on the Patient Dashboard Regimen tab. Comma separated list of name of concepts that are defined as drug sets.',30,'b54cac2c-2695-102d-b4c2-001d929acb54'),('dashboard.regimen.standardRegimens','<list>  <regimenSuggestion>    <drugComponents>      <drugSuggestion>        <drugId>2</drugId>        <dose>1</dose>        <units>tab(s)</units>        <frequency>2/day x 7 days/week</frequency>        <instructions></instructions>      </drugSuggestion>    </drugComponents>    <dis