37.',86,'b54cff6a-2695-102d-b4c2-001d929acb54'),('patientsummary.previousDiagnosisConceptId','992','Problem list construct concept id. Default: 992.',87,'b54d0032-2695-102d-b4c2-001d929acb54'),('patientsummary.started','true','DO NOT MODIFY. true/false whether or not the patientsummary module has been started.  This is used to make sure modules that were running  prior to a restart are started again',88,'b54d00f0-2695-102d-b4c2-001d929acb54'),('patientsummary.symptomPresentConceptId','1293','Review of symptoms on presentation concept id. Default: 1293.',89,'b54d01b8-2695-102d-b4c2-001d929acb54'),('patientsummary.vitalSigns','5089,5090','Comma delimited list of concept ids for vital signs\r\nDefaults: weight (5089), height (5090)',90,'b54d0280-2695-102d-b4c2-001d929acb54'),('patient_identifier.importantTypes','ARV Number,National id,PART Number,District TB Number,EID Number,KS Number,VHW ID','',91,'b54d033e-2695-102d-b4c2-001d929acb54'),('pihmalawihacks.started','true','DO NOT MODIFY. true/false whether or not the pihmalawihacks module has been started.  This is used to make sure modules that were running  prior to a restart are started again',92,'b54d0406-2695-102d-b4c2-001d929acb54'),('report.xmlMacros','macroPrefix=#\r\nmacroSuffix=#\r\n\r\nadultAtStart=[AgeOnDate|minAge=15|maxAge=|effectiveDate=${report.startDate}]\r\nadultAtEnd=[AgeOnDate|minAge=15|maxAge=|effectiveDate=${report.endDate}]\r\n\r\nchildAtStart=[AgeOnDate|minAge=0|maxAge=14|effectiveDate=${report.startDate}]\r\nchildAtEnd=[AgeOnDate|minAge=0|maxAge=14|effectiveDate=${report.endDate}]\r\n\r\naliveAtStart=[Alive|effectiveDate=${report.startDate}]\r\naliveAtEnd=[Alive|effectiveDate=${report.endDate]\r\n\r\nmaleAdult=#adultAtStart# AND [Male]\r\nmaleChild=#childAtStart# AND [Male]\r\n\r\nfemaleAdult=#adultAtStart# AND [Female]\r\nfemaleChild=#childAtStart# AND [Female]\r\n\r\n//Encounter Macros\r\n\r\nhadArtInitial=[ART_INITIAL|sinceDate=${report.startDate}|untilDate=${report.endDate}]\r\nhadArtFollowup=[ART_FOLLOWUP|sinceDate=${report.startDate}|untilDate=${report.endDate}]\r\n\r\nhadArtEncounter=#hadArtInitial# OR #hadArtFollowup#\r\n\r\nartRegLastWeek=[REGISTRATION|location=9|withinLastDays=7]\r\nartRegTwoWeeks=[REGISTRATION|location=9|withinLastDays=14]\r\nartRegWeekAgo=#artRegTwoWeeks# NOT #artRegLastWeek#\r\n\r\nartAptLastWeek=[APPOINTMENT|location=9|withinLastDays=7]\r\nartAptTwoWeeks=[APPOINTMENT|location=9|withinLastDays=14]\r\nartAptWeekAgo=#artAptTwoWeeks# NOT #artAptLastWeek#\r\n\r\nartScanWeekAgo = #artRegWeekAgo# OR #artAptWeekAgo#\r\nanyHIV = [Patients in HIV Program] OR [EID Program] OR [KS Program]\r\n\r\nartVisitNotEnrolled = #artScanWeekAgo# NOT #anyHIV#\r\n\r\n//Status Macros\r\ntransferredIn=[Transfer_In|sinceDate=${report.startDate}|untilDate=${report.endDate}]\r\ntransfInArt=#transferredIn#\r\n\r\nnewArt=#hadArtInitial# OR #transfInArt#\r\n\r\n//Drug Regimen Macros\r\n\r\n//First Line Sets\r\nonT30=[Drug|drugList=2|sinceDate=${report.startDate}|untilDate=${report.endDate}]\r\neverOnT30=[Drug|drugList=2|sinceDate=${report.startDate}|untilDate=${report.endDate}]\r\nonT40=[Drug|drugList=3|sinceDate=${report.startDate}|untilDate=${report.endDate}]\r\nonLS30=[currDrug|drugList=70|]\r\nonLamBaby=[Drug|drugList=71|sinceDate=${report.startDate}|untilDate=${report.endDate}]\r\nonTriBaby=[Drug|drugList=72|sinceDate=${report.startDate}|untilDate=${report.endDate}]\r\n\r\n//Second Line Sets\r\nonEFV=[Drug|drugList=11|drugList=28|drugList=29|drugList=30|sinceDate=${report.startDate}|untilDate=${report.endDate}]\r\n\r\n//Program State Sets\r\nhivDeadLowerLimit=[progStateOnOrBefore|program=1|stateList=3|untilDate=${report.startDate-1}]\r\nhivDeadOnOrAfter=[progStateOnOrAfter|program=1|stateList=3|sinceDate=${report.startDate}]\r\nhivDeadUpperLimit=[progStateOnOrAfter|program=1|stateList=3|sinceDate=${report.endDate+1}]\r\nhivDeadRange=#hivDeadOnOrAfter# NOT (#hivDeadLowerLimit# OR #hivDeadUpperLimit#)','',93,'b54d04ce-2695-102d-b4c2-001d929acb54'),('sched